DROP TABLE IF EXISTS `sd_order_detail_info`;

CREATE TABLE `sd_order_detail_info` (
  `detail_order_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '订单明细主键',
  `order_id` int(10) NOT NULL COMMENT '订单主键',
  `product_id` int(11) DEFAULT NULL COMMENT '产品主键',
  `customer_supplies` varchar(20) NOT NULL COMMENT '客户料号',
  `product_code` varchar(100) DEFAULT NULL COMMENT '产品代码',
  `product_name` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `detail_length` varchar(100) DEFAULT NULL COMMENT '长',
  `detail_width` varchar(100) DEFAULT NULL COMMENT '宽',
  `detail_height` varchar(100) DEFAULT NULL COMMENT '高',
  `is_lid` varchar(100) DEFAULT NULL COMMENT '是否带盖(0是,1否)',
  `price` varchar(100) DEFAULT NULL COMMENT '单价',
  `number` varchar(100) DEFAULT NULL COMMENT '数量',
  `cost_price` varchar(100) DEFAULT NULL COMMENT '成本价',
  `product_type_id` varchar(100) DEFAULT NULL COMMENT '类别(product_type.product_type_id)',
  `product_grade_id` varchar(100) DEFAULT NULL COMMENT '材质(product_grade.product_grade_id)',
  `immediately_inventory` varchar(100) DEFAULT NULL COMMENT '即时库存',
  `discount_before_sum` varchar(100) DEFAULT NULL COMMENT '整单折前金额',
  `money` varchar(100) DEFAULT NULL COMMENT '金额',
  `tax_rate` varchar(100) DEFAULT NULL COMMENT '税率',
  `sell_tax` varchar(100) DEFAULT NULL COMMENT '销售税额',
  `practical_sell_price` varchar(100) DEFAULT NULL COMMENT '实际含税价',
  `price_sell_sum` varchar(100) DEFAULT NULL COMMENT '价税合计',
  `relevance_number` varchar(100) DEFAULT NULL COMMENT '关联数量',
  `take_out_number` varchar(100) DEFAULT NULL COMMENT '出库数量',
  `bom_type` varchar(100) DEFAULT NULL COMMENT 'BOM类别',
  `file_url` varchar(100) DEFAULT NULL COMMENT '附件上传地址',
  `file_name` varchar(100) DEFAULT NULL COMMENT '文件名称',
  `REMARK` varchar(100) DEFAULT NULL COMMENT '备注',
  `STATUS` varchar(2) DEFAULT 'Y' COMMENT '状态（Y正常,N禁用）',
  `CREATE_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_USER_ID` varchar(100) NOT NULL COMMENT '创建人编号(SYS_USER_INFO.USER_ID)',
  `CREATE_USER_NAME` varchar(100) NOT NULL COMMENT '创建人姓名(SYS_USER_INFO.USER_NAME)',
  `CREATE_DEPART_ID` varchar(100) DEFAULT NULL COMMENT '创建人所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `CREATE_DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '创建人所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  `LAST_UPDATE_TIME` datetime DEFAULT NULL COMMENT '最后更新时间',
  `LAST_UPDATE_USER_ID` varchar(100) DEFAULT NULL COMMENT '最后更新人编号(SYS_USER_INFO.USER_ID)',
  `LAST_UPDATE_USER_NAME` varchar(100) DEFAULT NULL COMMENT '最后更新人姓名(SYS_USER_INFO.USER_NAME)',
  `LAST_UPDATE_DEPART_ID` varchar(100) DEFAULT NULL COMMENT '最后更新所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `LAST_UPDATE_DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '最后更新所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  `sd_id` varchar(10) DEFAULT NULL COMMENT '系统框架主键',
  PRIMARY KEY (`detail_order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=99 DEFAULT CHARSET=utf8 COMMENT='订单产品详情信息表';

