/*Table structure for table `sd_product_cost` */

DROP TABLE IF EXISTS `sd_product_cost`;

CREATE TABLE `sd_product_cost` (
  `product_cost_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '产品费用主键',
  `product_main_id` varchar(100) DEFAULT NULL COMMENT '产品编号',
  `product_cost_name` varchar(100) DEFAULT NULL COMMENT '费用类别标识',
  `product_unit` varchar(100) DEFAULT NULL COMMENT '计量单位',
  `product_number` varchar(100) DEFAULT NULL COMMENT '数量',
  `product_price_rate` varchar(100) DEFAULT NULL COMMENT '单价价格/比率',
  `product_main_unit_cost` varchar(100) DEFAULT NULL COMMENT '单位成本',
  `REMARK` varchar(100) DEFAULT NULL COMMENT '备注',
  `STATUS` varchar(100) NOT NULL DEFAULT 'Y' COMMENT '状态（Y正常,N禁用）',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `CREATE_USER_ID` varchar(100) NOT NULL COMMENT '创建人编号(SYS_USER_INFO.USER_ID)',
  `CREATE_USER_NAME` varchar(100) NOT NULL COMMENT '创建人姓名(SYS_USER_INFO.USER_NAME)',
