/*Table structure for table `sys_dictionary_type_info` */

DROP TABLE IF EXISTS `sys_dictionary_type_info`;

CREATE TABLE `sys_dictionary_type_info` (
  `DICTIONARY_TYPE_ID` varchar(10) NOT NULL COMMENT '字典主键',
  `DICTIONARY_TYPE_NAME` varchar(10) NOT NULL COMMENT '字典名称',
  `DICTIONARY_TYPE_DESC` varchar(100) NOT NULL COMMENT '字典内容描述',
  `REMARK` varchar(100) DEFAULT NULL COMMENT '备注',
  `STATUS` varchar(100) DEFAULT 'Y' COMMENT '状态（Y正常,N禁用）',
  `CREATE_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_USER_ID` varchar(100) NOT NULL COMMENT '创建人编号(SYS_USER_INFO.USER_ID)',
  `CREATE_USER_NAME` varchar(100) NOT NULL COMMENT '创建人姓名(SYS_USER_INFO.USER_NAME)',
  `CREATE_DEPART_ID` varchar(100) DEFAULT NULL COMMENT '创建人所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `CREATE_DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '创建人所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  `LAST_UPDATE_TIME` datetime DEFAULT NULL COMMENT '最后更新时间',
  `LAST_UPDATE_USER_ID` varchar(100) DEFAULT NULL COMMENT '最后更新人编号(SYS_USER_INFO.USER_ID)',
  `LAST_UPDATE_USER_NAME` varchar(100) DEFAULT NULL COMMENT '最后更新人姓名(SYS_USER_INFO.USER_NAME)',
  `LAST_UPDATE_DEPART_ID` varchar(100) DEFAULT NULL COMMENT '最后更新所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `LAST_UPDATE_DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '最后更新所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  PRIMARY KEY (`DICTIONARY_TYPE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_dictionary_type_info` */

/*Table structure for table `sys_flow_task` */

DROP TABLE IF EXISTS `sys_flow_task`;

CREATE TABLE `sys_flow_task` (
  `SOURCE_ID` varchar(10) NOT NULL,
  `STEP_ORDER` int(11) DEFAULT NULL,
  `STEP` varchar(100) DEFAULT NULL,
  `IS_DISPOSED` varchar(100) DEFAULT NULL,
  `STEP_DESC` varchar(100) DEFAULT NULL,
  `FUNCTION_ID` varchar(100) DEFAULT NULL,
  `FLOW_OPERATE_FUNCTION_ID` varchar(100) DEFAULT NULL,
  `FLOW_UNION_FILED` varchar(100) DEFAULT NULL,
  `CREATE_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `FLOW_BATCH_NO` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`SOURCE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_flow_task` */

/*Table structure for table `sys_flow_tasked` */

DROP TABLE IF EXISTS `sys_flow_tasked`;

CREATE TABLE `sys_flow_tasked` (
  `SOURCE_ID` varchar(10) NOT NULL,
  `STEP_ORDER` int(11) DEFAULT NULL,
  `STEP` varchar(100) DEFAULT NULL,
  `IS_DISPOSED` varchar(100) DEFAULT NULL,
  `STEP_DESC` varchar(100) DEFAULT NULL,
  `FUNCTION_ID` varchar(100) DEFAULT NULL,
  `FLOW_OPERATE_FUNCTION_ID` varchar(100) DEFAULT NULL,
  `FLOW_UNION_FILED` varchar(100) DEFAULT NULL,
  `CREATE_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `FLOW_BATCH_NO` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`SOURCE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_flow_tasked` */

/*Table structure for table `sys_function_info` */

DROP TABLE IF EXISTS `sys_function_info`;

CREATE TABLE `sys_function_info` (
  `FUNCTION_ID` varchar(100) NOT NULL COMMENT '主键',
  `FUNCTION_NAME` varchar(10) NOT NULL COMMENT '菜单名称',
  `FUNCTION_DESC` varchar(100) DEFAULT NULL COMMENT '菜单描述',
  `PARENT_FUNCTION_ID` varchar(10) NOT NULL COMMENT '父菜单编号',
  `FUNCTION_URL` varchar(1000) NOT NULL COMMENT '菜单链接地址',
  `FUNCTION_SEQUE` varchar(100) NOT NULL COMMENT '菜单顺序',
  `IS_VIRTUAL` varchar(10) NOT NULL COMMENT '是否虚节点（0：虚节点，1：实节点）',
  `FUNCTION_TYPE` varchar(10) NOT NULL COMMENT '菜单类型（1、功能；2、操作按钮）',
