DROP TABLE IF EXISTS `sys_user_info`;

CREATE TABLE `sys_user_info` (
  `USER_ID` int(10) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '单位编号',
  `USER_NAME` varchar(100) NOT NULL COMMENT '用户名',
  `LOGIN_NAME` varchar(100) NOT NULL COMMENT '系统登录名(登录用户名)',
  `LOGIN_PWD` varchar(100) NOT NULL COMMENT '系统登录密码',
  `DEPART_ID` varchar(100) DEFAULT NULL COMMENT '所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  `DEPART_POWER` varchar(100) DEFAULT NULL,
  `position` varchar(100) DEFAULT NULL COMMENT '0.外协经理,1.核价经理2.采购经理3.检验经理4.采购员，5检验员',
  `SEX` varchar(100) DEFAULT NULL COMMENT '性别（1男2女）',
  `PHONE` varchar(100) DEFAULT NULL COMMENT '电话',
  `EMAIL` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `QQ` varchar(100) DEFAULT NULL COMMENT 'QQ',
  `BRITHDAY` varchar(100) DEFAULT NULL COMMENT '生日',
  `wx_open_id` varchar(500) DEFAULT NULL COMMENT '微信Id',
  `WX_NICK_NAME` varchar(100) DEFAULT NULL COMMENT '微信昵称',
  `WX_HEAD_IMG_URL` varchar(100) DEFAULT NULL COMMENT '微信头像地址',
  `IS_ONLINE` varchar(1) DEFAULT 'N' COMMENT 'IS_ONLINE',
  `LASTLOGINTIME` date DEFAULT NULL COMMENT '上一次登录的时间',
  `STATE` varchar(2) DEFAULT '1' COMMENT '用户状态（1、正常；2：停用；3冻结）',
  `ACCOUNT_TYPE` varchar(2) DEFAULT '2' COMMENT '提成比例编号',
  `REG_IP` varchar(50) DEFAULT NULL COMMENT '账户绑定IP',
  `REG_MAC` varchar(50) DEFAULT NULL COMMENT '账户绑定mac',
  `EMPLOYE_NO` varchar(100) DEFAULT NULL COMMENT '员工编号',
  `IS_MARRAY` varchar(1) DEFAULT NULL COMMENT '是否已婚（1：已结婚、2：未结婚）',
  `REMARK` varchar(400) DEFAULT NULL COMMENT '备注',
  `STATUS` varchar(100) DEFAULT 'Y' COMMENT '状态（Y正常,N禁用）',
  `CREATE_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_USER_ID` varchar(100) NOT NULL COMMENT '创建人编号(SYS_USER_INFO.USER_ID)',
  `CREATE_USER_NAME` varchar(100) NOT NULL COMMENT '创建人姓名(SYS_USER_INFO.USER_NAME)',
  `CREATE_DEPART_ID` varchar(100) DEFAULT NULL COMMENT '创建人所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `CREATE_DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '创建人所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  `LAST_UPDATE_TIME` datetime DEFAULT NULL COMMENT '最后更新时间',
  `LAST_UPDATE_USER_ID` varchar(100) DEFAULT NULL COMMENT '最后更新人编号(SYS_USER_INFO.USER_ID)',
  `LAST_UPDATE_USER_NAME` varchar(100) DEFAULT NULL COMMENT '最后更新人姓名(SYS_USER_INFO.USER_NAME)',
  `LAST_UPDATE_DEPART_ID` varchar(100) DEFAULT NULL COMMENT '最后更新所属科室编号(SYS_DEPART_INFO.DEPART_ID)',
  `LAST_UPDATE_DEPART_NAME` varchar(100) DEFAULT NULL COMMENT '最后更新所属科室名称(SYS_DEPART_INFO.DEPART_NAME)',
  PRIMARY KEY (`USER_ID`),
  UNIQUE KEY `UK_sys_user_info` (`LOGIN_NAME`)
) ENGINE=InnoDB AUTO_INCREMENT=3517 DEFAULT CHARSET=utf8;

